import styled from "styled-components";

const Container = styled.div``;
const MainLayer = styled.div`
  background-color: blueviolet;
  width: 100%;
  height: 46em;
  display: flex;
  flex-direction: column;
  padding: 12em 7em;
  box-sizing: border-box;
  @import url("https://fonts.googleapis.com/css2?family=Black+Han+Sans&display=swap");
  /* font-family: "Black Han Sans", sans-serif; */
  @import url("https://fonts.googleapis.com/css2?family=Chakra+Petch:wght@300&family=Do+Hyeon&display=swap");
  /* font-family: "Do Hyeon"; */

  white-space: pre-wrap;
`;
const MainText = styled.span`
  /* display: inline-block; */
  /* @import url("https://fonts.googleapis.com/css2?family=Chakra+Petch:wght@300&family=Do+Hyeon&display=swap"); */
  /* font-family: "Do Hyeon"; */

  /* @import url("https://fonts.googleapis.com/css2?family=Black+Han+Sans&display=swap"); */
  font-size: 4em;
  color: whitesmoke;
  height: 3em;
  background-color: aqua;
  /* font-family: "Black Han Sans", sans-serif; */
  white-space: pre-wrap;
`;
const SubText = styled.div`
  font-size: 1em;
  color: whitesmoke;
  background-color: darkorange;
  /* font-family: "Black Han Sans", sans-serif; */
`;

const SubLayer = styled.div``;

function MainSection() {
  const mainText = "여행의 모든 것\n트리플로 한 번에";
  const subText = "예약부터 일정까지 앱 하나로 간편하게 준비하세요.";

  // mainText.replace(/\n/g, "<br>");
  return (
    <Container>
      <MainLayer>
        <MainText>{mainText}</MainText>
        <SubText>{subText}</SubText>
      </MainLayer>
      <SubLayer></SubLayer>
    </Container>
  );
}

export default MainSection;
